import React from 'react';
import {Link} from "react-router-dom";

const Menu = () => {
    return (
       <>
       <Link to="/">about  </Link>
       <Link to="/contact">Contact  </Link>
       <Link to="/service">Service  </Link>
       </>
    )
}

export default Menu
